import React from 'react';
import './App.css';
import NavBar from './Components/NavBar/NavBar'

function App() {

  this.state = {
    currentPage: null,
    word: "Test"
  }


  return (
    <div className="App">
      <h1>ryan slevin</h1>
      <NavBar />
      <p>{this.state.test}</p>

    </div>
  );
}

export default App;
